import { useParams } from "react-router-dom";
import ApiStatus from "../ApiStatus";
import { UseFetchDetailContact } from "../hooks/ContactHooks";

const ContactDetails = () =>
{
    const {id} = useParams();
    if(!id) throw Error("House id not found");
    const ContactId = parseInt(id);

    const {data,status,isSuccess} = UseFetchDetailContact(ContactId);
    if(!isSuccess) return <ApiStatus status={status}/>
    if (!data) return <div>contact didn't found</div>
    return(

        <div className="row">

      <div className="col-6">
      <br></br>
      <br></br>
        <div className="row mt-2">

          <h1 className="col-12">{data.firstName}</h1><h3 className="col-12">{data.lastName}</h3>



        </div>
        <div className="row">

          <h3 className="col-12">{data.lastName}</h3>
        </div>
        <div className="row">

          <h3 className="themeFontColor col-12">
            {(data.email)}
          </h3>
        </div>
        <div className="row">

          <div className="col-12 mt-3">{data.phoneNumber}</div>
        </div>

      </div>
    </div>
    )

}
export default ContactDetails;
